const SERIES = ["maS_USAn", "GPRC"];
const EVENTS = [{"date": "1991-08-01", "label": "Start of the Persian Gulf War"}, {"date": "2001-09-01", "label": "9/11"}, {"date": "2003-03-01", "label": "Iraq War"}, {"date": "2011-02-01", "label": "Civil War in Libya"}, {"date": "2022-02-01", "label": "Russia\u2013Ukraine"}];
const DEFAULT = new Set(["maS_USAn", "GPRC"]);
const countries = Object.keys(DATA).sort();

const sel = document.getElementById("country");
const seriesBox = document.getElementById("seriesBox");

function makeCheckboxes() {
  seriesBox.innerHTML = "";
  SERIES.forEach((s) => {
    const id = "cb_" + s;
    const checked = DEFAULT.has(s);
    const wrap = document.createElement("label");
    wrap.innerHTML = `<input type="checkbox" id="${id}" ${checked ? "checked" : ""}> ${s}`;
    seriesBox.appendChild(wrap);
  });
}

function selectedSeries() {
  return SERIES.filter(s => document.getElementById("cb_" + s).checked);
}

function plot() {
  const c = sel.value;
  const d = DATA[c];
  const x = d.date;

  const ser = selectedSeries();
  if (ser.length === 0) {
    Plotly.newPlot("chart", [], {
      title: c + "  (no series selected)",
      xaxis: { title: "Month" },
      margin: { t: 60, l: 60, r: 30, b: 60 }
    }, {responsive:true});
    return;
  }

  const traces = ser.map(s => {
    return {
      x: x,
      y: d[s],
      mode: "lines",
      name: s
    };
  });

  const shapes = EVENTS.map(ev => ({
    type: "line",
    xref: "x",
    yref: "paper",
    x0: ev.date,
    x1: ev.date,
    y0: 0,
    y1: 1,
    line: { width: 1, dash: "dot" }
  }));

  const annotations = EVENTS.map(ev => ({
    x: ev.date,
    y: 1.02,
    xref: "x",
    yref: "paper",
    text: ev.label,
    showarrow: false,
    xanchor: "left",
    font: { size: 11 }
  }));

  const layout = {
    title: c,
    xaxis: { title: "Month" },
    yaxis: { title: "Value" },
    legend: { orientation: "h" },
    margin: { t: 70, l: 60, r: 30, b: 60 },
    shapes: shapes,
    annotations: annotations
  };

  Plotly.newPlot("chart", traces, layout, {responsive: true});
}

countries.forEach(c => {
  const opt = document.createElement("option");
  opt.value = c;
  opt.textContent = c;
  sel.appendChild(opt);
});

makeCheckboxes();

let idx = countries.indexOf("Belgium");
if (idx < 0) idx = countries.indexOf("United States");
sel.selectedIndex = (idx >= 0) ? idx : 0;

sel.addEventListener("change", plot);
SERIES.forEach(s => document.getElementById("cb_" + s).addEventListener("change", plot));

plot();
</script>
